/*!50003 CREATE*/ /*!50017 DEFINER=`root`@`localhost`*/ /*!50003 TRIGGER `update_dn_header_on_insert` AFTER INSERT ON `trans_transaksi_dn_detail`
 FOR EACH ROW BEGIN
		SET @total_dn_detail = (SELECT IFNULL(SUM(a.total),0) FROM trans_transaksi_dn_detail a where a.no_surat_jalan = NEW.no_surat_jalan );
		SET @total_dn_header = (SELECT b.tarif + (b.tarif_lift_of * b.jum_lift_of) + (b.tarif_multidrop * b.jum_multidrop) FROM trans_transaksi_dn_header b where b.no_surat_jalan = NEW.no_surat_jalan) ;
								
    UPDATE trans_transaksi_dn_header 
		SET total = @total_dn_detail + @total_dn_header
    WHERE no_surat_jalan = NEW.no_surat_jalan;
END */;;
DELIMITER ;
