  `kode_kustomer` varchar(10) NOT NULL,
  `kode_route` varchar(16) NOT NULL,
  `kode_bongkar1` varchar(5) DEFAULT NULL,
  `kode_bongkar2` varchar(5) DEFAULT NULL,
  `kode_bongkar3` varchar(5) DEFAULT NULL,
  `opt_tarif` enum('-','Tujuan','Balikan') NOT NULL,
  `shift` enum('','1','2','3') NOT NULL,
  `tgl_berangkat` datetime NOT NULL,
  `tgl_est_tiba_di_kust` datetime NOT NULL,
  `tgl_akt_tiba_di_kust` datetime NOT NULL,
  `tgl_est_POD` datetime NOT NULL,
  `tgl_aktual_POD` datetime NOT NULL,
  `tgl_info_ke_KS` datetime DEFAULT NULL,
  `kode_produk` varchar(5) DEFAULT NULL,
  `nomor_unit` varchar(20) NOT NULL,
  `kode_supir` varchar(10) DEFAULT NULL,
  `nomor_kontainer` varchar(15) DEFAULT NULL,
  `kode_kapal` varchar(5) DEFAULT NULL,
  `jum_multidrop` int(11) NOT NULL DEFAULT '0',
